export function drawSky(p,carbonData,currentDate){
  var currentYear = currentDate.getFullYear();
  if (currentYear<2010){

    p.background(231, 181, 137);
  }
  else{
    var current_index =currentYear-2010
    console.log(carbonData[current_index]);
    p.background(231, 250, 137);
  }


}
